import React from "react";
import { TextField, MenuItem, ThemeProvider } from "@material-ui/core";
import languages from "../data/languages";

export default class Inputs {
  render() {
    return (
      <div classname="Inputs">
        <ThemeProvider>
          <TextField id="filled-basic" label="Word" variant="filled" />
          <TextField
            select
            label="Language"
            value={languages}
            onChange={(e) => handleChange(e)}
            className="select"
          >
            {languages.map((item) => (
              <MenuItem key={item.label} value={item.label}>
                {item.value}
              </MenuItem>
            ))}
          </TextField>
        </ThemeProvider>
      </div>
    );
  }
}
